    - '&cSell: &a$%math_2_{javascript_dmshop-items_468,sell}% &6each'
    - '&8Left Click to Purchase'
    - '&8Right Click to Sell'
    - '&8&oShift-Click to Purchase/Sell More'
    left_click_requirement:
      requirements:
        money:
          type: has money
          placeholder: '%javascript_dmshop-items_468,buy%'
          deny_commands:
          - '[message] &cYou do not have enough money'
    left_click_commands:
    - '[placeholder] %checkitem_give_mat:{javascript_dmshop-items_468,name},amt:1%'
    - '[console] eco take %player_name% %javascript_dmshop-items_468,buy%'
    shift_left_click_commands:
    - '[player] buyMore 468 shopPageNine'
    right_click_requirement:
      requirements:
        item:
          type: string equals
          input: '%checkitem_mat:{javascript_dmshop-items_468,name},amt:1%'
          output: 'yes'
          deny_commands:
          - '[message] &cYou do not have enough items'
    right_click_commands:
    - '[placeholder] %checkitem_remove_mat:{javascript_dmshop-items_468,name},amt:1%'
    - '[console] eco give %player_name% %math_{javascript_dmshop-items_468,sell}%'
    shift_right_click_commands:
    - '[player] sellMore 468 shopPageNine'

